define({"topics" : [{"title":"Protocol","href":"datacollector\/UserGuide\/Destinations\/Syslog.html#concept_bkx_srf_ffb","attributes": {"data-id":"concept_bkx_srf_ffb",},"menu": {"hasChildren":false,},"tocID":"concept_bkx_srf_ffb-d46e165585","topics":[]},{"title":"Enabling SSL\/TLS","href":"datacollector\/UserGuide\/Destinations\/Syslog.html#task_fcg_q1k_ffb","attributes": {"data-id":"task_fcg_q1k_ffb",},"menu": {"hasChildren":false,},"tocID":"task_fcg_q1k_ffb-d46e165607","topics":[]},{"title":"Message Content","shortdesc":"\n               <p class=\"shortdesc\">A syslog message includes fields such as a timestamp, facility code, severity level,         message ID, and the log message\n                  itself. You construct the syslog message content by         specifying the values for message fields on the Message tab. The\n                  content of the log message         depends on how you configure the Data Format tab. \n               </p>\n            ","href":"datacollector\/UserGuide\/Destinations\/Syslog.html#concept_dcb_4v3_gfb","attributes": {"data-id":"concept_dcb_4v3_gfb",},"menu": {"hasChildren":false,},"tocID":"concept_dcb_4v3_gfb-d46e165639","topics":[]},{"title":"Data Formats","shortdesc":"\n               <p class=\"shortdesc\">The Syslog destination writes data to the log message based on the data format that         you select.</p>\n            ","href":"datacollector\/UserGuide\/Destinations\/Syslog.html#concept_udw_31l_ffb","attributes": {"data-id":"concept_udw_31l_ffb",},"menu": {"hasChildren":false,},"tocID":"concept_udw_31l_ffb-d46e165684","topics":[]},{"title":"Configuring a Syslog Destination","href":"datacollector\/UserGuide\/Destinations\/Syslog.html#task_bbc_pt5_w2b","attributes": {"data-id":"task_bbc_pt5_w2b",},"menu": {"hasChildren":false,},"tocID":"task_bbc_pt5_w2b-d46e165739","topics":[]}]});